import React from 'react';

export default function Skills() {
  const frontend = ['React', 'React Native', 'Redux', 'HTML5', 'CSS3', 'Tailwind/CSS'];
  const backend = ['Node.js', 'Express', 'MongoDB', 'REST APIs'];
  const design = ['Figma', 'Adobe XD', 'Wireframing', 'Prototyping', 'Usability Testing'];

  const renderBadges = (list) => list.map((s, i) => <span key={i} className="skill-badge">{s}</span>);

  return (
    <div className="container skills">
      <h2>Skills</h2>
      <div className="skills-grid">
        <div>
          <h3>Frontend</h3>
          <div>{renderBadges(frontend)}</div>
        </div>
        <div>
          <h3>Backend</h3>
          <div>{renderBadges(backend)}</div>
        </div>
        <div>
          <h3>Design / UX</h3>
          <div>{renderBadges(design)}</div>
        </div>
      </div>
    </div>
  );
}
